protected Queue getPlanQueue(String planQueueName) {
  CSQueue queue = cs.getQueue(planQueueName);
  if (!(queue instanceof PlanQueue)) {
    LOG.error("The Plan is not an PlanQueue!");
    return null;
  }
  return queue;
}
